Actionscript.script:
function 是否可强化检测()
{
	var icon = this.强化图标.itemIcon;
	是否可强化 = false;
	当前强化等级 = icon.value.level;
	强化上限检测();
	if(!下一强化等级 || 下一强化等级 <= 当前强化等级){
		下一强化等级 = 当前强化等级 + 1;
	}
	if (icon.itemData.type != "武器" && icon.itemData.type != "防具")
	{
		提示 = "此类装备不可强化！只能强化枪、刀，和防具。<BR>";
		强化按钮._visible = false;
		return;
	}
	if (当前强化等级 >= 强化度上限)
	{
		提示 = 上限提示;
		强化按钮._visible = false;
		return;
	}
	强化石倍率 = 1;
	if (_root.主角被动技能.铁匠 && _root.主角被动技能.铁匠.启用)
	{
		强化石倍率 = Math.max(1 - _root.主角被动技能.铁匠.等级 * 0.05, 0);
	}
	强化石需要个数 = 0;
	强化石节省个数 = 0;
	if(下一强化等级 > 当前强化等级){
		for(var i = 当前强化等级; i < 下一强化等级; i++){
			强化石需要个数 += Math.floor(强化石倍率 * (i - 1) * (i - 1) * (i - 1) + 1);
			强化石节省个数 += Math.ceil((1 - 强化石倍率) * (i - 1) * (i - 1) * (i - 1));
		}
	}
	//强化石需要个数 = Math.floor(强化石倍率 * (当前强化等级 - 1) * (当前强化等级 - 1) * (当前强化等级 - 1) + 1);
	if (_root.singleContain(强化材料, 强化石需要个数))
	{
		是否可强化 = true;
		铁匠提示 = 强化石倍率 < 1 ? "，铁匠被动技能已节省" + 强化石节省个数 + "个" : "";
		提示 = "强化到"+ 下一强化等级+ "级，需要强化石" + 强化石需要个数 + "个" + 铁匠提示 + "。<BR>强化石充足，可以强化！";
		强化按钮._visible = true;
		return;
	}
	提示 = "强化到"+ 下一强化等级+ "级，需要强化石" + 强化石需要个数 + "个。<BR>强化石不足，不可继续强化！";
	强化按钮._visible = false;
}
//
function 装备强化()
{
	var icon = this.强化图标.itemIcon;
	if (目标icon.item === icon.item)
	{
		if (_root.singleSubmit(强化材料, 强化石需要个数))
		{
			目标icon.item.value.level = 下一强化等级;
			目标icon.refreshValue();
			目标icon = null;
			gotoAndStop("成功");
		}
		else
		{
			提示 = "强化石不足，不可继续强化！<BR>";
		}
	}
	else
	{
		提示 = "物品无法对应，请重新拖入装备！";
	}
}
function 强化上限检测(){
	强化度上限 = 13;
	if (_root.主线任务进度 < 130)
	{
		强化度上限 = 9;
		if (_root.主线任务进度 < 75)
		{
			强化度上限 = 7;
		}
		if (_root.主角被动技能.铁匠 && _root.主角被动技能.铁匠.启用 && _root.主角被动技能.铁匠.等级 >= 10)
		{
			强化度上限 += 1;
		}
		上限提示 = "当前阶段的上限为" + 强化度上限 + "级，强化等级已经达到当前阶段的上限，不可继续强化！推进流程可获得更高级别的强化技术。<BR>";
	}
}
当前强化等级 = 0;
下一强化等级 = 1;
强化度上限 = 13;
上限提示 = "强化等级最高为13级，已经达到最大，不可继续强化！<BR>";
强化上限检测();
强化材料 = "强化石";
提示 = "";
强化按钮._visible = false;

目标icon = null;

stop();

_root.排列物品图标();
stop();
_root.联机2015发送传言("强化");
_root.全部翻译(this);

function 是否可强化度转换检测()
{
	是否可强化度转换 = true;
	var icon1 = this.强化图标左.itemIcon;
	var icon2 = this.强化图标右.itemIcon;
	if (icon1.name == null)
	{
		是否可强化度转换 = false;
		提示 = _root.获得翻译("请将要转换强化度的装备放入左边的框中。") + "<BR>";
		强化度转换按钮._visible = 0;
		return undefined;
	}
	if (icon2.name == null)
	{
		是否可强化度转换 = false;
		提示 = _root.获得翻译("请将要转换强化度的装备放入右边的框中。") + "<BR>";
		强化度转换按钮._visible = 0;
		return undefined;
	}
	if (icon1.itemData.type != "武器" && icon1.itemData.type != "防具")
	{
		是否可强化度转换 = false;
		提示 = _root.获得翻译("此类装备不可强化度转换！只能支持枪、刀，和防具。") + "<BR>";
		强化度转换按钮._visible = 0;
		return undefined;
	}
	if (icon2.itemData.type != "武器" && icon2.itemData.type != "防具")
	{
		是否可强化度转换 = false;
		提示 = _root.获得翻译("此类装备不可强化度转换！只能支持枪、刀，和防具。") + "<BR>";
		强化度转换按钮._visible = 0;
		return undefined;
	}
	if (icon1.itemData.use != icon2.itemData.use)
	{
		是否可强化度转换 = false;
		提示 = _root.获得翻译("同类物品才可强化度转换！") + "<BR>";
		强化度转换按钮._visible = 0;
		return undefined;
	}
	if (icon1.value.level > 13 || icon2.value.level > 13)
	{
		是否可强化度转换 = false;
		提示 = _root.获得翻译("强化等级已经超过最大，不可强化度转换！") + "<BR>";
		强化度转换按钮._visible = 0;
		return undefined;
	}
	if (icon1.value.level == icon2.value.level)
	{
		是否可强化度转换 = false;
		提示 = _root.获得翻译("两个物品强化等级相同，不需强化度转换！") + "<BR>";
		强化度转换按钮._visible = 0;
		return undefined;
	}
	转换价格 = 100;
	if (_root.主角被动技能.铁匠 && _root.主角被动技能.铁匠.启用)
	{
		转换价格 = Math.max(100 - _root.主角被动技能.铁匠.等级 * 10, 0);
	}
	提示 = _root.获得翻译("强化度转换条件满足！需要花费" + 转换价格 + "K点。确认转换吗？") + "<BR>";
	是否可强化度转换 = true;
	强化度转换按钮._visible = 1;
	return undefined;
}
function 强化度转换开始()
{
	var icon1 = this.强化图标左.itemIcon;
	var icon2 = this.强化图标右.itemIcon;
	if (目标icon1.item === icon1.item && 目标icon2.item === icon2.item)
	{
		提示 = _root.获得翻译("开始转换！请稍候！");
		转换价格 = 100;
		if (_root.主角被动技能.铁匠 && _root.主角被动技能.铁匠.启用)
		{
			转换价格 = Math.max(100 - _root.主角被动技能.铁匠.等级 * 10, 0);
		}
		虚拟币支付(转换价格,"O20111009000000010");
	}
	else
	{
		提示 = _root.获得翻译("物品无法对应，请重新拖入装备！");
	}
}
function 虚拟币支付(amount, 商品编号)
{
	if (_root.虚拟币 >= amount)
	{
		var icon1 = this.强化图标左.itemIcon;
		var icon2 = this.强化图标右.itemIcon;
		_root.虚拟币 -= amount;
		_root.发布消息(_root.获得翻译("支付成功！"));
		_root.播放音效("收银机.mp3");
		if (目标icon1.item === icon1.item && 目标icon2.item === icon2.item)
		{
			var level1 = 目标icon1.item.value.level;
			var level2 = 目标icon2.item.value.level;
			目标icon1.item.value.level = level2;
			目标icon2.item.value.level = level1;
			目标icon1.refreshValue();
			目标icon1 = null;
			目标icon2.refreshValue();
			目标icon2 = null;
			提示 = _root.获得翻译("转换成功！");
			gotoAndStop("转换等待中");
			play();
		}
	}
	else
	{
		_root.发布消息(_root.获得翻译("K点不足！"));
	}
}
提示 = "";
目标icon1 = null;
目标icon2 = null;
强化度转换按钮._visible = 0;
_root.全部翻译(this);

_root.排列物品图标();
stop();
_root.全部翻译(this);

