on (release) {
	_parent.gotoAndPlay("刷新");
}
onClipEvent (load) {
	显示文字 = _root.获得翻译("清空");
}

on (release) {
	if (下一强化等级 < 强化度上限)
	{
		if (_root.物品栏[this.强化图标.对应数组号][0] == _root.装备强化界面.强化图标.临时物品名称 && _root.物品栏[this.强化图标.对应数组号][1] == this.强化图标.数量)
		{
			下一强化等级 += 1;
			是否可强化检测();
		}
	}
}

on (release) {
	if (下一强化等级 > 当前强化等级 + 1)
	{
		if (_root.物品栏[this.强化图标.对应数组号][0] == _root.装备强化界面.强化图标.临时物品名称 && _root.物品栏[this.强化图标.对应数组号][1] == this.强化图标.数量)
		{
			下一强化等级 -= 1;
			是否可强化检测();
		}
	}
}

on (release) {
	if (下一强化等级 > 1)
	{
		if (_root.物品栏[this.强化图标.对应数组号][0] == _root.装备强化界面.强化图标.临时物品名称 && _root.物品栏[this.强化图标.对应数组号][1] == this.强化图标.数量)
		{
			下一强化等级 = 强化度上限;
			是否可强化检测();
		}
	}
}

on (release) {
	if (下一强化等级 > 1)
	{
		if (_root.物品栏[this.强化图标.对应数组号][0] == _root.装备强化界面.强化图标.临时物品名称 && _root.物品栏[this.强化图标.对应数组号][1] == this.强化图标.数量)
		{
			下一强化等级 = Number(当前强化等级 + 1);
			是否可强化检测();
		}
	}
}

on (release) {
	if (开始强化 == false)
